column8:
DVDプレイヤー・スピーカー一体型プロジェクターだから、いつでもどこでも大画面。専用シアタールームが無くても、真っ暗にしなくても、ナチュラルで色鮮やかな大画面映像を楽しめます。狭い部屋でも大画面が楽しめる、天井投写キット（標準同梱）で天井にも投映可能です。明るさ2500ルーメン、コントラスト3000:1。最適画質を賢く選択する、おまかせカラーモード搭載。面倒なモード調整は不要、部屋の明るさを光センサーが自動的に感知し、最適な画質モードを選択します。パワフルな明るさとUSBディスプレイ機能、マイク入力端子搭載で、ビジネスシーンでもお勧めです。<!-- お気に入りボタン対応　start　-->
