スマートフォン プロジェクター Luckies Projector 組立式のスマートフォン用プロジェクターです。<br><br>
8倍率レンズを通して静止画や動画を壁に大画面で映し出すことができます。<br>
厚紙を組み立てて作るだけのシンプルな構造で組み立てる為に必要なものは接着剤だけです。<br>
プロジェクターの外側に充電ケーブルを通す穴が装備されているので、長時間の使用も心配要りません。<br><br>

ブランド：Luckies<br>
サイズ：W16.5×D18×H9.8cm<br>
素材：ボール紙、レンズ<br></DIV>
